export default function Header() {
  return (
    <header className="bg-gray-900 p-6 shadow-lg">
      <div className="container mx-auto flex justify-center">
        <img
          src="/images/logo.png"
          alt="lForex & AI Logo"
          className="w-24 h-24 rounded-full"
        />
      </div>
    </header>
  );
}
